css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("surfingbird.ru") {


  
  .b-feeds__item {    
    background: #303030 none repeat scroll 0% 0%;
    display: inline-block;
    float: left;
    margin: 0px 0px 20px;
    transition: opacity 300ms linear 0s;
    opacity: 0;
    width: 235px;
    vertical-align: top;}
  .info-desc_size_big {color: #C2B9B9;}
  .info-desc {color: #DEDEDE;}
  .info-adduser__user{color: #868686;}
  .b-outer_bg_gray {background-color: #383838;}
  .b-header {background-color: #4B4B4B;}
  .b-button{background: #757575;}
  .b-popup {background: #414040;}
  .b-parser div, .b-parser p {color: #999;}
  .b-toolbar {background-color: #747474;}
  .b-outer_display_table{background-color: #454545;}
}
